text:
{ a note for the men }
::
men. this is a hard time to be a man. much of our feminine culture is anti-patriarchy, which in extremes bleeds into anti-manhood. sometimes it means you donâ€™t get a chance to be you in full expression without judgment just for being a man. guys, stand up. press in. you are hearing words like â€œthe future is femaleâ€ that can elicit inner feelings of â€œwhere do i fit in?â€ your softness and tenderness are beautiful. your empathy and tears are just as manly as your strength and assertiveness. feel them. express it all. we women sometimes write off all men because of the traumatic experiences we had with a few. it is not fair or right. we know you are not a part of that group, and we are sorry for where we have generalized. many of us have been wounded and victimized by men, and in all truth, many of you have been victimized and wounded by women. there is a massive disconnect. we donâ€™t always see the commonalities we have. we donâ€™t all understand quite yet that you are the key to our future. because...the reality is that we canâ€™t live without you. you are essential for our worldâ€™s healing and growth. the future is not female. the future is also not male. the future is balance. harmony. integrated masculine and feminine. the future is us working together, learning together, expressing our strengths and weaknesses in full acceptance. expressing where we have both wronged one another. understanding our different and similar experiences and struggles and hopes. the future is love. and you, dear masculine soul are a beautiful, needed part of that. when we come together in acceptance, forgiveness, and understanding, we together are a force to be reckoned with. ğŸ™ğŸ¼

